import { createApp } from 'vue'
import App from './App.vue'
import store from './store.js'
import { router } from './router.js'
import { Quasar } from 'quasar'
// import quasarUserOptions from './quasar-user-options'

var app = createApp(App);

app.use(store);
app.use(router);
app.use(Quasar);

app.mount('#app');
